Opisthosoma of immature spiders ventrally orange with wide transverse black band close to the epigastric furrow (
Fig. 60
). In females, the dark band grows in size after each moult, until covering the whole ventral surface. In males, the orange colour remains or changes to brown in adults, but never to black.
